	var suits=["clubs","hearts","diamonds","spades"];
	
	var arr=[];
	for(var i=0;i<suits.length;i++){

		for(var j=0;j<array.length;j++){
			if(suits[i]==array[j].suit)
			{
				c++;
			}
		}
		arr.push(c);
	}
	return suits[arr.indexOf(Math.max(...arr))];
	

}
